import React from 'react'

export default class Nav extends React.Component{
  state={
    clicked: false
  }

  menuClick = () => {
    if(this.state.clicked === false){
      this.setState({
        clicked: true
      })
    }
  }

  render(){
    return(
      <div>
      <div className="ui secondary pointing menu">
        <a href="Menu" className="item" onClick={this.menuClick}>
          Menu
        </a>
          {this.state.clicked ? <div class="ui visible sidebar"></div> : null}
        <div className="right menu">
          <a href="home" className="ui item">
            <i class="linkedin icon"></i>
          </a>
          <a href="messages" className="ui item">
            <i class="github icon"></i>
          </a>
          <a href="friends" className="ui item">
            <i class="instagram icon"></i>
          </a>
          <a href="friends" className="ui item">
            <i class="medium icon"></i>
          </a>
        </div>
        </div>
      </div>
    )
  }
}
